import Button from "../components/Button";
import Header from "../components/Header";

const Result = () => {
    return(
        <div>
            <Header
                title="result page"
            />
            <Button text="공유하기"/>
            <Button text="다시하기"/>
        </div>
    )
}

export default Result;
